import { Question } from "./components/Question.js";
import { QuestionNavbar } from "../QuestionNavbar.js";

export const Questions = () => {
  return (
    <div className="questions">
      <QuestionNavbar />
      <Question
        title={
          "Sinulle on ehdotettu jutun aihetta tai sinulla on idea jutun aiheesta, jonka tunnistat mielipiteitä jakavaksi ja tunteita herättäväksi.​ Miten toimit?​"
        }
        options={[
          { value: "Mielenkiinnolla otan haasteen vastaan.", navigate: "" },
          { value: "Teen jutun, koska se on työtäni.", navigate: "" },
          {
            value: "En halua tehdä juttua polarisoivasta aiheesta.",
            navigate: "",
          },
        ]}
      />
    </div>
  );
};
